  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is of nine georeferenced
  aerial images taken over Quivira National Wildlife Refuge on June 19th and 27th,
  1985.  This data set is a clipped, georeferenced version of images collected under
  the NHAP program in the 1980s. These photos were downloaded from Earth Explorer
  (USGS). The original photos (see SourceFiles folders at the Region 6 Regional Office)
  were georeferenced against 2012 NAIP images. This data set provides a snap shot
  in time during the 1980s. Like other historic photos, this image allows for interpretation
  of habitat types on the refuge at that time. Change over time estimates can be made
  from this image using current imagery for comparison. This image, along with others,
  are being used by refuge staff to assist in understanding and visualizing the historical
  content of the lands within the refuge and how they have changed over the last 50
  years. Pixel resolution of these images is  5 meters. These images should be used
  for resource-level interpretation only.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
